import React from 'react';

function Weather() {

    const gps = navigator.geolocation.getCurrentPosition(
        function (position) {
            for (key in position.coords) {
                console.log(key + " " + position.coords[key]);
            }
        });
    return (
        <div>
            Pogoda!
        </div>
    );
}

export default Weather;
